import React from 'react'
import {Col, Container, Row} from 'react-bootstrap'
import TopBar from './TopBar'

class Page extends React.Component {

	render() {
		return (
			<>
				<TopBar />
				<br/>
				<Container>
					<Row>
						<Col/>
						<Col md={10}>{this.props.children}</Col>
						<Col/>
					</Row>
				</Container>
			</>
		);
	}
}

export default Page;
